import AddIcon from '@material-ui/icons/Add';
import Note from './note';
const App = () => {
    const [note , setNote] = useState({
        title:'',
        content:''
    }) 
    return (
        <>
        <div><Header /></div>
       <div><CreateNode /></div> 
        <Footer />
        <Button >
            <AddIcon/>
        </Button>
        <Note />

        </>
    )
}
export default App;
